con:config.script:
//wyczyszczenie wartosci Properties
testSuite = testRunner.testCase.testSuite
for(int i=0;i<testSuite.getPropertyCount();i++)
{
 	testSuite.getPropertyAt(i).setValue("");
}

//ustawienie nazwy pliku z danymi testowymi w Properiest
testRunner.testCase.testSuite.setPropertyValue("testData", "test_data.txt")

//pobranie nazwy pliku z danymi do testu
def fileName = testRunner.testCase.testSuite.getPropertyValue("testData")

//przygotowanie listy properties do zapisu
def props = new Properties()
String data = new File(context.expand('${projectDir}') + "/" + fileName).text
def dataList = data.split(',').collect{it as String}
def dataListSize = dataList.size()

//petla sprawdzajaca metody add i multiply dla poszczegolnych par rekordow
for (i=0; i<dataListSize; i++) {
	String value = "value" + i
	String element1 = dataList[i]
	String element2 = dataList[i+1]

//zapis poszczegolnych rekordow w "Custom Properties" z poziomu TestSuite
	testRunner.testCase.testSuite.setPropertyValue(value, element1)
	testRunner.testCase.testSuite.setPropertyValue("valueA",element1)
	testRunner.testCase.testSuite.setPropertyValue("valueB",element2)

//W przypadku metody add liczba 2 jest kolejnym elementem listy po liczbie 1. Gdy liczba 1 jest ostatnim elementem listy, liczba 2 jest losowana z listy.
	if (element2 == null) {
		def random = new Random();
		def randomNum = random.nextInt(dataListSize)
		testRunner.testCase.testSuite.setPropertyValue("valueB", dataList[randomNum].toString())
		log.warn "No available number for Value 2, inserting random value " + dataList[randomNum] + " from list."
		element2 = testRunner.testCase.testSuite.getPropertyValue("valueB")
	}

//uruchomienie test stepu  add
	def testStepAdd = testRunner.testCase.testSteps["add"]
	testStepAdd.run(testRunner,context)

//gdy dodawanie wykona sie prawidlowo, warunek przechodzi do kolejnych test stepow
	def testStepAddResult = context.testCase.testSteps["add"].run(testRunner, context).getStatus().toString();
	if ( testStepAddResult == "OK") {
		log.info "Value1 = " + element1 + ", Value2 = " + element2

//uruchomienie transferu wyniku dodawania do Properties
		def testStepTransfer1 = testRunner.testCase.testSteps["addresult2properties"]
		testStepTransfer1.run(testRunner,context)
		addResult = testRunner.testCase.testSuite.getPropertyValue("addResult")
		log.warn "Add Result = " + addResult

//uruchomienie test stepu multiply
		def testStepMultiply = testRunner.testCase.testSteps["multiply"]
		testStepMultiply.run(testRunner,context)
		log.info "Value1 = " + element1 + ", Value2 = " + addResult

//uruchomienie transferu wyniku mnozenia do Properies
		def testStepTransfer2 = testRunner.testCase.testSteps["multiplyresult2properties"]
		testStepTransfer2.run(testRunner,context)
		multiplyResult = testRunner.testCase.testSuite.getPropertyValue("multiplyResult")
		log.warn "Multiply Result = " + multiplyResult

//porownanie spodziewanego wyniku mnozenia z faktycznym zwroconym przez API
		int expectedResult = element1.toInteger() *addResult.toInteger()
		log.warn "Expected Result = " + expectedResult
		assert expectedResult == multiplyResult.toInteger()

		log.info "TEST SCRIPT PASSED"
	}
	else {

//error w przypadku, gdy dodawanie wykona sie nieprawidlowo
		log.error("TEST SCRIPT FAILED");
		log.error "Value1 = " + element1 + ", Value2 = " + element2
	}
}
